 class App extends Component {
   constructor(props){
       super(props);
       this.run= this.run.bind(this);
   }

    render(){
        return (
            <div>
             <h1>serverless functions </h1>
             <button onClick={this.run}>Click</button>
            </div>
        )

    }

   run(){
       console.log('clicked');
      API.post('nAPI', '/items',{body:{number:20}})
